import { useState } from 'react';
import Scanner from '../components/QrScaner/Scanner';
const Rent = () => {
  const [data, setData] = useState(null);
  const [done, setDone] = useState(true);
  const ScanComplete = (props) => {
    setData(props);
    setDone(false);
  };
  return (
    <div>
      {done && <Scanner scan={ScanComplete} />}
      {data && <p>{data}</p>}
    </div>
  );
};

export default Rent;
